■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">仕上がりの美しさ・なめらかさは格別！ガラス職人手作りのチェコ製爪ヤスリ♪ビックリするほど素早く削れる！ギザギザ・欠け・２枚爪もちょ～っと削るだけで削り残しなくつるっつる！もうこれ以外、使えない！シャリシャリ削って、あっという間に指先美人★</font></td></tr></table><br><table width="300" border="0" cellpadding="0" cellspacing="0" bgcolor="#666666"><tr><td><table width="300" border="0" cellspacing="1" cellpadding="5"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">大：約13.2&times;1.2&times;0.3cm<br>小：約8.8&times;1.0&times;0.2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">特殊ガラス</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">チェコ</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6--><style type="text/css">
